var teams = [];
var teams_colors = [0, 180];

kick = function(i,reason="Unspecified."){
  game.ships[i].gameover({"You were kicked for reason: ":reason,"Your name: ":game.ships[i].name,"Kicked by:":game.ships[0].name,"Score: ":game.ships[i].score});
};

info = function(){
  game.modding.terminal.echo('Total amount of aliens:'+game.aliens.length);
  game.modding.terminal.echo('Total amount of asteroids:'+game.asteroids.length);
  game.modding.terminal.echo('Total amount of players:'+game.ships.length);
  for (nn=0;nn<game.ships.length;nn++){
    game.modding.terminal.echo(nn+": "+game.ships[nn].name+', type: '+game.ships[nn].team+' X,Y: '+game.ships[nn].x+', '+game.ships[nn].y);
  }
};

function healShip(ship){
  if (ship != null){
    ship.set({healing:!ship.healing});
  }
}

function GetTeam () {
  let smallestTeam = 0;
  for (i = 0; i < game.options.friendly_colors; i++) {
    if (teams[smallestTeam].length > teams[i].length) {
      smallestTeam = i;
    }
  }
  return smallestTeam;
}

var mothership_tick = mothership_timer*3600;

this.tick = function(game) {
  if (game.step % 60 === 0) {
    for (let ship of game.ships){
      if (!ship.custom.init){
        ship.custom.init = true;
        ship.frags = 0;
        ship.deaths = 0;
        ship.setUIComponent({
          id: "healer",
          position: [5,28,16/1.2,20/2/1.2],
          visible: true,
          clickable: true,
          shortcut: "J",
          components: [{type:"text",position:[6,4,88/1.2/1.2,40/1.2*2/1.2],value:"Healer [J]",color:"#cde"},]
        });  
      }
    }
    for (var i = 0; i < game.options.friendly_colors; i++) {
      radar.components = [];
      teams[i] = [];
    }
    for (var ship of game.ships) {     
      if (ship.type == mothership_type) {
        motherships[ship.team] = true;
      } else if (!motherships[ship.team]) {
        teams[ship.team].push(ship);
        game.setUIComponent(radar);
      }
     // game.modding.terminal.echo(teams[0].length + " " + teams[1].length)
      for (var i = 0; i < game.options.friendly_colors; i++) {
        if (!motherships[i] && game.custom.init){
          if (teams[i].length > 0) {
             echo(`${motherships} mother ship being set`);
            setMotherShip(teams[i][Math.floor(Math.random() * teams[i].length)]);
            motherships[i] = true;
          }
        }
      }
      if (!ship.custom.set_team) {
        let team_id = GetTeam();
        ship.set({team: team_id, hue: teams_colors[team_id]});
        ship.custom.set_team = true;
      }
      if (ship.custom.mothership) {
        let x = transform.X(ship.x)*zoom - (ind.size/2),y = transform.Y(ship.y)*zoom-(ind.size/2);
        radar.components.push(
          {type:"round", position:[t(x),t(y),ind.size+s(x),ind.size+s(y)], fill: `hsla(${hues[ship.team]},100%,50%,0.5)`},
          {type:"text", value: ind.symbol,position:[t(x),t(y),ind.size+s(x),ind.size+s(y)], fill: `hsla(${hues[ship.team]},100%,50%,0.5)`}
        );
      }
    }
    if (game.step<mothership_tick){
      let steps = mothership_tick - game.step;
      let minutes = Math.floor(steps / 3600);
      let seconds = Math.floor((steps % 3600) / 60);
      if (seconds < 10) seconds = "0" + seconds;
      if (minutes < 10) minutes = "0" + minutes;
      game.setUIComponent ({
        id: "timer_ui",
        position: [50, 10, 10, 11.5],
        clickable: false, 
        visible: true,
        components: [
          {type:"text",position:[0,0,60,60],value:minutes+":"+seconds , color: "#cde"}
        ]
      })
    } else {
      game.setUIComponent ({id: "timer_ui", visible: false});
      game.custom.init = true;
    }
  }
}

this.event = function(event,game) {
  switch (event.name) {
    case "ui_component_clicked":
      var component = event.id;
      if (component == "healer") healShip(event.ship);
    break;
    case "ship_destroyed":
      event.killer.frags++;
      event.ship.deaths++;
      if (event.ship.type == 791) {
        //revertShip(ship);
        for (let ship of game.ships) {
          if (ship.team == event.ship.team) {
            ship.gameover({
              "Status":"Your mothership has been destroyed",
              "":"","":"",
              "Score":ship.score,
              "Frags":ship.frags,
              "Deaths":ship.deaths
            });
          } else {
            ship.gameover({
              "Status":"The enemy's mothership has been destroyed, congrats!",
              "":"","":"",
              "Score":ship.score,
              "Frags":ship.frags,
              "Deaths":ship.deaths
            });
          }
        }
      }
    break;
  }
};

var setMotherShip = function(ship) {
  ship.custom.old_type = ship.type;
  ship.custom.old_stats = ship.stats;
  ship.custom.mothership = true;
  ship.set({
    type: mothership_type,
    shield: mothership_shield,
    generator: mothership_generator,
  });
};
